import Vue from 'vue';
import VueRouter from 'vue-router';

// Import your views/components
import Home from '../views/Home.vue';
import About from '../views/About.vue';
import Service from '../views/Service.vue';
import Why from '../views/Why.vue';
import Team from '../views/Team.vue';
Vue.use(VueRouter);
const routes = [{
  path: '/',
  name: 'Home',
  component: Home
}, {
  path: '/about',
  name: 'About',
  component: About
}, {
  path: '/service',
  name: 'Service',
  component: Service
}, {
  path: '/why',
  name: 'Why',
  component: Why
}, {
  path: '/team',
  name: 'Team',
  component: Team
}];
const router = new VueRouter({
  mode: 'history',
  routes
});
export default router;
